import React from 'react';

const PredictedResults = ({ predictedData, onReset }) => {
  const { predicted_disease, description, precautions, recommended_diet, workout } = predictedData;

  return (
    <div className="border border-gray-300 rounded-lg p-4 mt-4">
      <h2 className="text-xl font-bold mb-2">Predicted Disease: {predicted_disease}</h2>
      <p className="mb-2"><strong>Description:</strong> {description}</p>
      <h3 className="font-bold">Precautions:</h3>
      <ul className="list-disc list-inside mb-2">
        {precautions.map((precaution, index) => (
          <li key={index}>{precaution}</li>
        ))}
      </ul>
      <p><strong>Recommended Diet:</strong> {recommended_diet}</p>
      <p><strong>Workout:</strong> {workout}</p>
      <button
        onClick={onReset}
        className="bg-gray-300 text-gray-700 px-4 py-2 rounded-lg mt-4 hover:bg-gray-400"
      >
        Reset
      </button>
    </div>
  );
};

export default PredictedResults;
